import React, { Component } from 'react'
import CardNota from './CardNota'

class ListaDeNotas extends Component {
  render() {
    return (
      <ul>
        <li>
          <div>trabalho</div>
          <CardNota></CardNota>
        </li>
        <li>
        <div>trabalho</div>
          <CardNota></CardNota>
        </li>
        <li>
        <div>estudo</div>
          <CardNota></CardNota>
        </li>
      </ul>
    );
  }
}

export default ListaDeNotas;
